import React, { Component } from 'react';

class Nav extends Component {
  render() {
    return (

        <nav>
	    <div class="nav-wrapper">
	      <a href="#" class="brand-logo">MERN Social</a>
	    </div>
	  </nav>
      
    );
  }
}

export default Nav;
